import React from 'react';
import TVrow from '../components/tvs/TVrow';
import styles from './TVshows.module.css';

const base_url = 'https://image.tmdb.org/t/p/original';

const Movies = () => {
  return (
    <div className={styles.tv}>
      <h3 className={styles['tv-nav']}>TV Shows</h3>
      <TVrow
        url="/movie/popular?api_key=8a45061d820fb7b5b5f574766f028ff6"
        category="Popular"
      />
      <TVrow
        url="/movie/top_rated?api_key=8a45061d820fb7b5b5f574766f028ff6"
        category="Top Rated"
      />
      <TVrow
        url="/movie/upcoming?api_key=8a45061d820fb7b5b5f574766f028ff6"
        category="Upcoming"
      />
      <TVrow
        url="/movie/popular?api_key=8a45061d820fb7b5b5f574766f028ff6"
        category="Popular"
      />
    </div>
  );
};

export default Movies;
